import React,{Component} from 'react'
import './App.css';
import Form from './components/Form'
import Table from './components/Table'
import Modal from 'react-modal'

function App() {
  return (
    <div className="App">
      <Form/>
      <Table/>

      <Modal isOpen = {true}>
        <h2>Modal title</h2>
        <p>Modal Body</p>
      </Modal>
    </div>
  );
}

export default App;
